# Radial basis dispatch (values only)
@inline function evaluate_Rnl(r::T, iz::Int, jz::Int)::SVector{N_RNL, T} where {T}
    pair_idx = zz2pair_sym(iz, jz)
    if pair_idx == 1; return evaluate_Rnl_1(r)
    elseif pair_idx == 2; return evaluate_Rnl_2(r)
    elseif pair_idx == 3; return evaluate_Rnl_3(r)
    elseif pair_idx == 4; return evaluate_Rnl_4(r)
    end
    return zero(SVector{N_RNL, T})
end

# Radial basis dispatch (with derivatives)
@inline function evaluate_Rnl_d(r::T, iz::Int, jz::Int)::Tuple{SVector{N_RNL, T}, SVector{N_RNL, T}} where {T}
    pair_idx = zz2pair_sym(iz, jz)
    if pair_idx == 1; return evaluate_Rnl_d_1(r)
    elseif pair_idx == 2; return evaluate_Rnl_d_2(r)
    elseif pair_idx == 3; return evaluate_Rnl_d_3(r)
    elseif pair_idx == 4; return evaluate_Rnl_d_4(r)
    end
    return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T})
    end

